    constructor(props){
        super(props);
    }


    onPageNumberChange = (page) =>{
        console.log()
    }

    render(){
        console.log(this.props)
        const {pageSize} = this.props.product;
        return(
            <Pagination defaultCurrent={1} total={pageSize} onChange={this.onPageNumberChange}/>
        )
    }
}
const mapStatetoProps = state => {
